            PhotoController controller = new PhotoController(this._storageService, hostingEnvironmentMock.Object);

            string photoBase64String = "data:image/jpeg;base64,";
            string photoBase64StringHeader = photoBase64String.Split(',')[0];
            string photoBase64StringData = photoBase64String.Split(',')[1];
            string fileExt = photoBase64StringHeader.Split(',')[0].Split(":")[1].Split("/")[1].Split(";")[0];
            var fileContent = Convert.FromBase64String(photoBase64StringData);

            var inserted = await controller.Post(new Photo() { Url = $"test_Photo_1.{fileExt}", Title = "  1", SortOrder = 1, Data = fileContent});
            if (inserted)
            {
                Assert.True(inserted);
            }
        }

